import React from "react";
import TvPresenter from "./TvPresenter";

export default class extends React.Component {
  state = {
    topRated: null,
    popular: null,
    airingToday: null,
    error: null,
    loading: true
  };
  render() {
    return <TvPresenter />;
  }
}
